import Axio from './AxiosCalls'

export default class Funciones{
    constructor(){
        this.data = null;
        this.information = null;
    }

    datosTabla(params) {
        console.log(params);
        var param=JSON.stringify(params);
        return Axio.get('getRef.do?'+{param})
        .then((response)=>response.json)
        .then(function(data){
            this.data=data;
        }.bind(this))
    }

}
